import React from "react";
import styled from "styled-components";

const NavbarContainer = styled.div`
  width: 100vw;
  display: flex;
  height: 40px;
  background-color: red;
`;

export const Navbar: React.FC = () => {
  return <NavbarContainer></NavbarContainer>;
};
